import { Nav, NavItem, NavLink } from 'reactstrap';

const Header = (props) => (
   <Nav style={{width: "100%"}}>
      <NavItem style={{width: "20%", padding: "1%"}}>
         <img src={props.navlogo} className="img-fluid" />
      </NavItem>
      {
         props.navitems.map(navitem => (
               <NavItem key={navitem.key}>
                  <NavLink href={navitem.link}>{navitem.label}</NavLink>
               </NavItem>
            )
         )
      }
   </Nav>
)

export default Header
